import React from 'react'
import './styles/Post.css'

export default function Post({picture}) {
  return (
    <div className='PostLayout'>
      <img src={picture} style={{maxWidth: '100%'}}></img>

      <p style={{fontFamily: ''}}>It has 1 Diesel Engine and 1 Petrol Engine on offer. The Diesel engine is 1993 cc while the Petrol engine is 1496 cc . It is available with Automatic transmission.Depending upon the variant and fuel type the C-Class has a mileage of 23.0 kmpl</p>
    </div>
  )
}
